import React from "react";



function Footer(){
    return (
        
      <footer className="f">
          <ul>
          <li>
            <a href="https://github.com/FatimaFBZ">GitHub</a>
        </li>
        <li>
            <a href="https://www.linkedin.com/in/fatima-baloch-a4391321b/">LinkedIn</a>
        </li>
          </ul>


      </footer>
    )
}

export default Footer;
